import React from 'react';
import { ArrowDown, CheckCircle } from 'lucide-react'; // Assuming you are using Lucide icons

// Define the type for each benefit
interface Benefit {
  title: string;
  icon: React.ReactNode; // Icon can be a React node
}

// Define the data structure for benefits
const benefits: Benefit[] = [
  {
    title: "XÁC LẬP QUYỀN CỦA CSH ĐỐI VỚI SÁNG CHẾ",
    icon: <CheckCircle aria-hidden="true" />,
  },
  {
    title: "NGĂN CHẶN VIỆC SAO CHÉP VÀ BẮT CHƯỚC",
    icon: <CheckCircle aria-hidden="true" />,
  },
  {
    title: "TĂNG GIÁ TRỊ THƯƠNG HIỆU - TĂNG UY TÍN",
    icon: <CheckCircle aria-hidden="true" />,
  },
  {
    title: "CƠ HỘI TIẾP CẬN TÀI NGUYÊN ĐẦU TƯ",
    icon: <CheckCircle aria-hidden="true" />,
  },
];

const PatentBenefits: React.FC = () => {
  return (
    <section className="section mcb-section mfn-default-section default-width">
      <div className="mcb-background-overlay"></div>
      <div className="section_wrapper mfn-wrapper-for-wraps">
        <div className="wrap mcb-wrap one tablet-one laptop-one mobile-one clearfix">
          <div className="mcb-wrap-inner mfn-module-wrapper">
            <div className="mcb-wrap-background-overlay"></div>
            <div className="column mcb-column mcb-item-59kwrojt one laptop-one tablet-one mobile-one column_icon_box_2">
              <div className="mcb-column-inner mfn-module-wrapper">
                <div className="mfn-icon-box mfn-icon-box-bottom mfn-icon-box-center">
                  <div className="icon-wrapper">
                    <ArrowDown aria-hidden="true" />
                  </div>
                  <div className="desc-wrapper">
                    <h3 className="title">LỢI ÍCH KHI ĐĂNG KÝ BẢO HỘ SÁNG CHẾ</h3>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>

        <div className="wrap mcb-wrap one-fourth tablet-one-fourth laptop-one-fourth mobile-one clearfix">
          <div className="mcb-wrap-inner mfn-module-wrapper">
            <div className="mcb-wrap-background-overlay"></div>
            {benefits.map((benefit, index) => (
              <div key={index} className="column mcb-column mcb-item-kz0n62xu7 one laptop-one tablet-one mobile-one column_icon_box_2">
                <div className="mcb-column-inner mfn-module-wrapper">
                  <div className="mfn-icon-box mfn-icon-box-top mfn-icon-box-center">
                    <div className="icon-wrapper">{benefit.icon}</div>
                    <div className="desc-wrapper">
                      <h4 className="title">{benefit.title}</h4>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default PatentBenefits;
